/* entry pack accessor implementation for oam_rx */
int soc_sbx_g3p1_oam_rx_pack(int unit,
    soc_sbx_g3p1_oam_rx_t *e, uint8 *b, int bsz)
{
    int i, pos, width, fbe;
    uint8 *p, *base;
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_OAM_RX_ID];
    int be = tm->behost;
    int bytes_to_clear;
    
    base = b;
    bytes_to_clear = bsz / 8;
    if (bsz & 0x7) {
        bytes_to_clear++;
    }
    sal_memset(b, 0, bytes_to_clear);
    
    base = b;
    if (be) {
        b+=bsz/8-1;
    }

    for (i = 0; i < ed->nfields; i++) {
        width = ed->fields[i].width;
        pos = ed->fields[i].pos;
        switch (i) {
             case 0: p = (uint8 *) &e->valid; break; 
            default: return SOC_E_INTERNAL;
        }
        fbe = be && width <= 32;
        if (fbe) {
            p += sizeof(uint32) - 1;
        }
        soc_sbx_g3p1_insert_or(b,
                be, pos, width, p, fbe, 0);
    }
    if (be)  {
        soc_sbx_caladan3_cmic_endian(base, bsz/8);
    }


    return SOC_E_NONE;
}         

