int soc_sbx_g3p1_oam_tx_get_ext_sim(int unit, int irulenum  , soc_sbx_g3p1_oam_tx_t *e)
{
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_OAM_TX_ID];
    char *buffer, *p, *q;
    char *fname[100] = {0};
    char *fval[100] = {0};
    int s, i, j, size, skipsize;
    uint32 val;
    int fcnt = 0;

    buffer = tm->simbuffer;
    memset(buffer, 0, tm->simbuffersize);
    memset(e, 0, sizeof(soc_sbx_g3p1_oam_tx_t));
    size = soc_sbx_caladan3_sim_block_encode(buffer, "ppe", "oam_tx", "get table", irulenum  );

    s = soc_sbx_caladan3_sim_sendrcv(unit, buffer, &size);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim sendrcv failed (%d)\n"), s));
        return s;
    }
    s = soc_sbx_caladan3_sim_status_decode(buffer, "status", &skipsize);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim get failed (%d)\n"), s));
        return s;
    }
    buffer += skipsize;
    size -= skipsize;
    
    /* Eliminating the ingr_src_queue and parse_state key words */
    p = buffer;
    while (*p) {
        skipsize = strlen("oam_state");
        if (sal_strncasecmp(p, "oam_state", skipsize)==0) {
            q = p + skipsize + 1;
            sal_sprintf(p, "%s", q);
            break;
        } 
        p++;
    }
    while (*p) {
        skipsize = strlen("parse_state");
        if (sal_strncasecmp(p, "parse_state", skipsize)==0) {
            q = p + skipsize + 1;
            sal_sprintf(p, "%s", q);
        } 
        p++;
    }
    
    fcnt = soc_sbx_caladan3_sim_split(buffer, size, fname, fval); 
    if (fcnt <= 0) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim decode failed (%d)\n"), s));
        return s;
    }
    for (i = 0; i < ed->nfields; i++) {
        for (j = 0; j < fcnt; j++) {
            if (sal_strcmp(fname[j],ed->fields[i].name)==0) {
                val = _shr_ctoi(fval[j]);
               
                switch (i) {
                     case 0: e->valid = val; break; 
                    default: 
                        LOG_ERROR(BSL_LS_SOC_COMMON,
                                  (BSL_META_U(unit,
                                              "\nCannot decode %s and %x "), fname[j], val));
                        continue;
                }
            }
        }
    }
    for (j = 0; j < fcnt; j++) {
        sal_free(fname[j]);
        sal_free(fval[j]);
    }
    return s;
}

