/* entry index checker for l2cpmac */
int soc_sbx_g3p1_l2cpmac_index_check(int unit,
                int *vindex,
                 int ilsi  )
{
    int i, r, pos, width, fmt, ibe, pibe;
    uint8 *p, *p0;
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_L2CPMAC_ID];
    soc_sbx_g3p1_index_desc_t *id;
    int psize =
        (ed->indexeswidth + sizeof(int) * 8 - 1) / (sizeof(int) * 8)
        * sizeof(int);
    int be = tm->behost;
    int pkbe = be;

    sal_memset(vindex, 0, psize);

    p0 = ((uint8 *) vindex) + (pkbe ? psize - 1 : 0);

    for (i = 0; i < ed->nindexes; i++) {
        id = &ed->indexes[i];
        width = id->width;
        pos = id->pos;
        fmt = id->format;
        switch (i) {
            case 0: p = (uint8 *) &ilsi; break; 
            default: return SOC_E_INTERNAL;
        }
        r = ed->indexes[i].range;
        if (0 < r && r <= *(int *) p) {
            soc_sbx_g3p1_ppe_errsym = ed->indexes[i].name;
            return SOC_E_PARAM;
        }
        ibe = be && width <= 32;
        if (ibe) {
            p += sizeof(int) - 1;
        }
  pibe = 
    (fmt == SOC_SBX_G3P1_BE_INTEGER_FORMAT
     || (fmt == SOC_SBX_G3P1_NATIVE_INTEGER_FORMAT && be));
        soc_sbx_g3p1_insert(p0,
               pkbe, pos, width, p, ibe, pibe != pkbe);
    }

    return SOC_E_NONE;
}

/* entry argument checker for l2cpmac */
int soc_sbx_g3p1_l2cpmac_entry_check(int unit,
                soc_sbx_g3p1_l2cpmac_t *e)
{
    int i, r;
    uint32 ev = 0;
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_L2CPMAC_ID];

    for (i = 0; i < ed->nfields; i++) {
        switch (i) {
             case 0: ev = e->portid; break; 
             case 1: ev = e->useport; break; 
             case 2: ev = e->mac[0]; break; 
        }
        r = ed->fields[i].range;
        if (0 < r && ((uint32) r) <= ev) {
            soc_sbx_g3p1_ppe_errsym = ed->fields[i].name;
            return SOC_E_PARAM;
        }
    }

    return SOC_E_NONE;
}

int soc_sbx_g3p1_l2cpmac_set_ext_sim(int unit, int ilsi  , soc_sbx_g3p1_l2cpmac_t *e)
{
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_L2CPMAC_ID];
    char *buffer;
    int s, i, size, skipsize;
    uint32 val = 0;

    buffer = tm->simbuffer;
    memset(buffer, 0, tm->simbuffersize);
    size = soc_sbx_caladan3_sim_block_encode(buffer, "ppe",  "l2cpmac", 
                                              "set table", ilsi  );
    size += soc_sbx_caladan3_sim_keyword_encode(buffer+size, "lsmac_state"); 
    for (i = 0; i < ed->nfields; i++) {
            break;
            /* coverity[unreachable] */
        size += soc_sbx_caladan3_sim_verb_encode(buffer+size,
                      ed->fields[i].name, val); 
    }

    size += soc_sbx_caladan3_sim_keyword_encode(buffer+size, "parse_state"); 

    for (i = 0; i < ed->nfields; i++) {
        switch (i) {
             case 0: val = e->portid; break; 
             case 1: val = e->useport; break; 
             /* case 2: val = e->mac; break; */ 
            default: 
                continue;
        }
        size += soc_sbx_caladan3_sim_verb_encode(buffer+size,
                      ed->fields[i].name, val); 
    }


    s = soc_sbx_caladan3_sim_sendrcv(unit, buffer, &size);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim sendrcv failed (%d)\n"), s));
        return s;
    }
    s = soc_sbx_caladan3_sim_status_decode(buffer, "status", &skipsize);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim set failed (%d)\n"), s));
    }
    return s;
}

/* entry set accessor implementation for l2cpmac */
int soc_sbx_g3p1_l2cpmac_set(int unit,
                 int ilsi  ,
                soc_sbx_g3p1_l2cpmac_t *e)
{
    int s, key[32];

    s = soc_sbx_g3p1_l2cpmac_index_check(unit, key, ilsi  );
    if (s) {
        return s;
    }

    s = soc_sbx_g3p1_l2cpmac_entry_check(unit, e);

    if (s) {
        return s;
    }
    s = soc_sbx_g3p1_l2cpmac_set_ext(unit,
                 ilsi  ,
                e);
    return s;
}

int soc_sbx_g3p1_l2cpmac_get_ext_sim(int unit, int ilsi  , soc_sbx_g3p1_l2cpmac_t *e)
{
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    soc_sbx_g3p1_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G3P1_PPE_L2CPMAC_ID];
    char *buffer, *p, *q;
    char *fname[100] = {0};
    char *fval[100] = {0};
    int s, i, j, size, skipsize;
    uint32 val;
    int fcnt = 0;

    buffer = tm->simbuffer;
    memset(buffer, 0, tm->simbuffersize);
    memset(e, 0, sizeof(soc_sbx_g3p1_l2cpmac_t));
    size = soc_sbx_caladan3_sim_block_encode(buffer, "ppe", "l2cpmac", "get table", ilsi  );

    s = soc_sbx_caladan3_sim_sendrcv(unit, buffer, &size);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim sendrcv failed (%d)\n"), s));
        return s;
    }
    s = soc_sbx_caladan3_sim_status_decode(buffer, "status", &skipsize);
    if (SOC_FAILURE(s)) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim get failed (%d)\n"), s));
        return s;
    }
    buffer += skipsize;
    size -= skipsize;
    
    /* Eliminating the ingr_src_queue and parse_state key words */
    p = buffer;
    while (*p) {
        skipsize = strlen("lsmac_state");
        if (sal_strncasecmp(p, "lsmac_state", skipsize)==0) {
            q = p + skipsize + 1;
            sal_sprintf(p, "%s", q);
            break;
        } 
        p++;
    }
    while (*p) {
        skipsize = strlen("parse_state");
        if (sal_strncasecmp(p, "parse_state", skipsize)==0) {
            q = p + skipsize + 1;
            sal_sprintf(p, "%s", q);
        } 
        p++;
    }
    
    fcnt = soc_sbx_caladan3_sim_split(buffer, size, fname, fval); 
    if (fcnt <= 0) {
        LOG_ERROR(BSL_LS_SOC_COMMON,
                  (BSL_META_U(unit,
                              "sim decode failed (%d)\n"), s));
        return s;
    }
    for (i = 0; i < ed->nfields; i++) {
        for (j = 0; j < fcnt; j++) {
            if (sal_strcmp(fname[j],ed->fields[i].name)==0) {
                val = _shr_ctoi(fval[j]);
               
                switch (i) {
                     case 0: e->portid = val; break; 
                     case 1: e->useport = val; break; 
                     /* case 2: e->mac = val; break; */
                    default: 
                        LOG_ERROR(BSL_LS_SOC_COMMON,
                                  (BSL_META_U(unit,
                                              "\nCannot decode %s and %x "), fname[j], val));
                        continue;
                }
            }
        }
    }
    for (j = 0; j < fcnt; j++) {
        sal_free(fname[j]);
        sal_free(fval[j]);
    }
    return s;
}

/* entry get accessor implementation for l2cpmac */
int soc_sbx_g3p1_l2cpmac_get(int unit, int ilsi  , soc_sbx_g3p1_l2cpmac_t *e)
{
    int s, key[32];


    s = soc_sbx_g3p1_l2cpmac_index_check(unit, key,
                 ilsi  );
    if (s) {
        return s;
    }
    s = soc_sbx_g3p1_l2cpmac_get_ext(unit,
                 ilsi  ,
                e);

    return s;
}

