/* PPE variable pack accessor implementation for egr_ppevar */
int soc_sbx_g3p1_egr_ppevar_pack(int unit, soc_sbx_g3p1_egr_ppevar_t *e, uint8 *b, int bsz)
{
    int i, pos, width, fbe;
    uint8 *p, *base;
    soc_sbx_g3p1_state_t *fe = (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm = fe->ppe_mgr;
    int be = tm->behost;
    int bytes_to_clear;

    base = b;
    bytes_to_clear = bsz / 8;
    if (bsz & 0x7)
    {
        bytes_to_clear++;
    }
    sal_memset(b, 0, bytes_to_clear);

    base = b;
    if (be)
    {
        b+=bsz/8-1;
    }
    for (i = 0; i < SOC_SBX_G3P1_EGR_PPEVAR_MEMBER; ++i)
    {
        width = g_soc_sbx_g3p1_egr_ppevar[i].width;
        pos = g_soc_sbx_g3p1_egr_ppevar[i].pos;
        switch (i)
        {
              case 0: p = (uint8 *) &e->pm_enable; break;
              case 1: p = (uint8 *) &e->lsm; break;
              case 2: p = (uint8 *) &e->loopback; break;
              case 3: p = (uint8 *) &e->pwe_y1731; break;
              case 4: p = (uint8 *) &e->mc; break;
             /* coverity[dead_error_begin] */
            default: return SOC_E_INTERNAL;
        }
        fbe = be && width <= 32;
        if (fbe)
        {
            p += sizeof(uint32) - 1;
        }
        soc_sbx_g3p1_insert_or(b, be, pos, width, p, fbe, 0);
    }
    if (be) 
    {
        soc_sbx_caladan3_cmic_endian(base, bsz/8);
    }
    return SOC_E_NONE;
}
