/*
 * PPE Table Manager initializer
 */
int soc_sbx_g3p1_ppe_tables_init(int unit)
{
    int rv;
    
    soc_sbx_g3p1_ppe_table_manager_t *tm;
    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;    
    uint32 v;
    
    if (!fe) {
        return SOC_E_INIT;
    }

    if (fe->ppe_mgr) {
        /* Free old info */
        soc_sbx_g3p1_ppe_tables_uninit(unit);
    }

    tm = sal_alloc(sizeof(soc_sbx_g3p1_ppe_table_manager_t), "ppe_tbl_mgr");
    if (!tm) {
      return SOC_E_MEMORY;
    }
    sal_memset(tm, 0, sizeof(soc_sbx_g3p1_ppe_table_manager_t));
    fe->ppe_mgr = tm;
    
    tm->indexes =  sal_alloc(sizeof(soc_sbx_g3p1_index_desc_t) * SOC_SBX_G3P1_PPE_MAX_TABLE_ID,
                           "ppe_mgr_idx");
    sal_memset(tm->indexes, 0, sizeof(soc_sbx_g3p1_index_desc_t) * SOC_SBX_G3P1_PPE_MAX_TABLE_ID);

    tm->entries =  sal_alloc(sizeof(soc_sbx_g3p1_entry_desc_t) * SOC_SBX_G3P1_PPE_MAX_TABLE_ID,
                             "ppe_mgr_entries");
    sal_memset(tm->entries, 0, sizeof(soc_sbx_g3p1_entry_desc_t) * SOC_SBX_G3P1_PPE_MAX_TABLE_ID);

    
    v = 0x1;
    tm->behost = !*((uint8 *) &v);   
  
    /* Sim support */
    tm->simbuffer = sal_alloc(1024, "ppe_sim_buffer");
    if (!tm->simbuffer) {
        return SOC_E_MEMORY;
    }
    tm->simbuffersize = 1024;
            
    rv = create_table_p2e(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_ep2e(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_tpid(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_oam_rx(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_oam_tx(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_lsmac(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_l2cpmac(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    rv = create_table_elsmac(unit, tm);
    if (rv != SOC_E_NONE) {
       soc_sbx_g3p1_ppe_tables_uninit(unit);
       return rv;
    }     
    
    return SOC_E_NONE;
}

/* Uninitialization function implementation */
int soc_sbx_g3p1_ppe_tables_uninit(int unit)
{
    int i;
    int s = SOC_E_NONE;

    soc_sbx_g3p1_state_t *fe =
        (soc_sbx_g3p1_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g3p1_ppe_table_manager_t *tm;

    if (!fe->ppe_mgr) return s;
    tm = fe->ppe_mgr;
    
    if (tm->entries) {
        for (i = 0; i < SOC_SBX_G3P1_PPE_MAX_TABLE_ID; i++) {
            if (tm->entries[i].fields) {
                sal_free(tm->entries[i].fields);
            }
            if (tm->entries[i].indexes) {
                sal_free(tm->entries[i].indexes);
            }
        }
        sal_free(tm->entries);
    }
    
    if (tm->simbuffer)   sal_free(tm->simbuffer);
        
    sal_free(tm);
    fe->ppe_mgr = NULL;

    return s;
}

